CREATE DEFINER=`okaro`@`localhost` PROCEDURE `ObtenerTicketsPorArea` (IN `nombreArea` VARCHAR(255))   BEGIN
    SELECT *
    FROM tickets
    WHERE id_area_ticket = (SELECT id_area FROM areas WHERE nombre_area = nombreArea);
END$$

CREATE DEFINER=`okaro`@`localhost` PROCEDURE `ObtenerTicketsPorPrioridad` (IN `prioridadBuscada` VARCHAR(255))   BEGIN
    SELECT *
    FROM tickets
    WHERE id_prioridad_ticket IN (SELECT id_prioridad FROM prioridades WHERE nombre_prioridad = prioridadBuscada);
END$$

